import image1 from "../assets/booking_schedule_isometric_illustration-05.jpg";
import image2 from "../assets/icons8-events-64.png";
import classes from "./HomePageImage.module.css";

const HomePageImage = () => {
	return (
		<div className={classes.container}>
			{/* <img src={image1} alt="events image"></img> */}
			<img
				src={image2}
				alt="events image"
				style={{ height: "20rem" }}
			></img>
		</div>
	);
};

export default HomePageImage;
